**Comparing Values of Two Variables**

To compare the values of two variables, you can use comparison operators. The specific operator used depends on the programming language. Here are some common comparison operators:

### Common Comparison Operators

* **Equal to**: `==` (checks if two values are equal)
* **Not equal to**: `!=` (checks if two values are not equal)
* **Greater than**: `>` (checks if one value is greater than another)
* **Less than**: `<` (checks if one value is less than another)
* **Greater than or equal to**: `>=` (checks if one value is greater than or equal to another)
* **Less than or equal to**: `<=` (checks if one value is less than or equal to another)

### Example in Python

```python
# define two variables
var1 = 10
var2 = 20

# compare the values of var1 and var2
if var1 == var2:
    print("var1 and var2 are equal")
elif var1 > var2:
    print("var1 is greater than var2")
else:
    print("var1 is less than var2")
```

### Example in JavaScript

```javascript
// define two variables
let var1 = 10;
let var2 = 20;

// compare the values of var1 and var2
if (var1 === var2) {
    console.log("var1 and var2 are equal");
} else if (var1 > var2) {
    console.log("var1 is greater than var2");
} else {
    console.log("var1 is less than var2");
}
```

Note: In JavaScript, `===` is used for strict equality checking (i.e., both value and type must be equal), while `==` is used for loose equality checking (i.e., only value must be equal).
